Juveniles: Size range of material examined 1.5– 7 mm long (n= 11 ; holotype 5 mm ), 1 –2.5 mm wide ( holotype 2 mm ) including chaetae, 12–26 segments ( holotype 25 ). Elytrae 12 pairs on segments 2, 4 , 5, 7 , 9, 11 , 13, 15 , 17, 19 , 21 and 24 , however the 11 th and 12 th pairs are greatly reduced and the 12 th pair of elytrae is absent in some of the smaller juveniles. First pair of elytrae have 1–11 papillae on the anterior margin ( 8 in holotype ); a scatter plot of number of papillae on the anterior margin of the first elytron versus body length (
Figure 6
) shows that size is a poor predictor of number of papillae (R 2 = 0.1). Elytrae 2 to 12 show the same lateral anterior to posterior projections, however the biggest difference seen between juveniles and adults is the presence of articulate lateral processes on the elytrae of juveniles (Figures 5 E–G). A scatterplot of number of lateral processes on the second elytron versus body length (
Figure 7
) demonstrates the progression from articulate to inarticulate lateral processes with increasing size of specimen.
